    const expandDiv = (e) => {
        // e.preventDefault()
        console.log(e)
        console.log(e.currentTarget.parentElement.parentElement.parentElement)

        const divToBeExpanded = e.currentTarget.parentElement.parentElement.parentElement

        console.log(divToBeExpanded)
    }

    return (
            <div className={styles.card}>
                <div className={styles.cardImage}>
                    <h1>{org}</h1>
                </div>
                <div className={styles.cardTitle}>
                    {/*<Button onClick={() => onclick()} text={text} color={"primary"} border={"3px"} width={"90%"} height={"50px"} fontSize={"1.5rem"} />*/}
                    <Link onClick={(e) => expandDiv(e)} text={text} color={"primary"} />
                </div>
            </div>
    )
}

export default ProfessionalCards
